front.net/nfl/11373.png\",\"nflByeWeek\":13,\"news\":[{\"timeEpochMilli\":\"1606081315000\",\"contents\":\"Davis rushed 19 times for 64 yards and a touchdown and brought in both his targets for 15 yards in the Panthers' 20-0 win over the Lions on Sunday.\",\"analysis\":\"Making another start for Christian McCaffrey (shoulder), Davis looked appreciably better than he had in weeks while facing some tough matchups. The veteran opened the scoring on the day with a one-yard walk-in touchdown to cap off a 10-play, 95-yard march late in the first quarter, a play that helped ensure he wouldn't have another pedestrian fantasy performance. Davis will be called upon again Week 12 if McCaffrey remains sidelined for a road matchup against the Vikings.\",\"title\":\"Gets back into end zone Sunday\"},{\"timeEpochMilli\":\"1606085862000\",\"contents\":\"Carolina Panthers running back Mike Davis compiled 19 rushes for 64 yards and a score along with two receptions for 15 yards on two targets in Week 11. Davis continued to fill in as the RB1 while Christian McCaffrey recovers from a shoulder injury. If McCaffrey returns, then Davis is no longer fantasy relevant. If the star RB cannot play, Davis should remain in the starting tier due to volume. Nevertheless, the backup RB has not rushed for more than 66 yards since Week 5.\",\"url\":\"https://www.rotoballer.com/player-news/mike-davis-has-rushing-touchdown/806838\",\"title\":\"Mike Davis Has Rushing Touchdown\"}],\"nameFirst\":\"Mike\",\"nameLast\":\"Davis\",\"proTeam\":{\"abbreviation\":\"CAR\",\"location\":\"Carolina\",\"name\":\"Panthers\"},\"positionEligibility\":[\"RB\"]},\"requestedGames\":[{\"game\":{\"id\":6302,\"away\":{\"abbreviation\":\"DET\",\"location\":\"Detroit\",\"name\":\"Lions\"},\"home\":{\"abbreviation\":\"CAR\",\"location\":\"Carolina\",\"name\":\"Panthers\"},\"startTimeEpochMilli\":\"1606068000000\",\"status\":\"FINAL_SCORE\",\"homeScore\":20,\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNo